import React, {Component} from 'react';
import students from '../mock-data/students.json';

class Grid extends Component {
    constructor(props){
        super(props);

        this.state = {
            studentsItems: []
        }

        this.setState({
            studentItems: [...students]
        })
    }





    render() {
        const gridStyle = {
            background: '#eee',
            margin: '0 0 0 300px',
            width: '100px',
            border: '1px solid black',
            padding: '1em',
            display: 'block'
        }

        return (

            <div className = 'Grid' style={gridStyle}>

                <div>
                    {studentItems=this.state.studentItems}
                </div>
            </div>
        )
            }
}
export default Grid;
